import React from "react";

const DarkModeToggle = ({ toggleDarkMode }) => {
  return (
    <button
      onClick={toggleDarkMode}
      style={{
        position: "absolute",
        top: "20px",
        right: "20px",
        fontSize: "18px",
        padding: "10px 20px",
        backgroundColor: "#ffffff",
        color: "#000000",
      }}
    >
      Dark Mode
    </button>
  );
};

export default DarkModeToggle;
